@kim.camille_ first powerlifting meet! It was an success! I had the honor of training you and prepping you for this, alongside the @metroflexlbc #family with such big help and support! You are a national @musclecontest qualifier, a @u.s._strict_curl_association_ #champion , and now an official elite total @uspapowerliftingfoundation @uspapower powerlifter. I am beyond proud and it’s only the beginning. Not forgetting to mention she got first place in her weight class in the open and submasters, and broke 2 state submasters class records! 
Videos coming soon! 

#proud #strong #legendary #mommy #momswholift #powerlifting #bodybuilding #love #brat #painintheass #bodybuilding

Coach had me going 😳 when he said “you taking 595 for a single today”. Last time I went this heavy was when I was a couple weeks out. I’m over two months out from nationals and there’s so much more room to still get stronger, it’s getting weirddddd…. #powerlifting #trainhard #hardwork #isymfs #legday #squats #discipline #dadbod #dadswholift 

Coaching @ollaaay 
@jaysmyname 
@c.t.ali.fletcher

Everything moved surprisingly well. @jaysmyname has always told me, don’t let this weight disrespect you, you disrespect this weight, you disrespect everything over 400lbs, it’s your weight and you’ve been training for this, handle… and today that’s what I did, thank you bro. Worked up to 418lb for a easy single. It’s getting real weirddddd. #bench #bigchest #powerlifting #strength #fitness #dadswholift #isymfs #dadbod #discipline #sacrifice 

